function animation(){
    let program = document.querySelector('div#program')
    let tools = document.querySelector('div#tools')
    let certificate = document.querySelector('div#certificacao')
    let rocket = document.querySelector('div#projeto')
    let astronaut = document.querySelector('div#astronaut')
    let sobre = document.querySelector('div#sobre')
    loadProgram(program)
    tools.innerHTML += loadTools()    
    certificate.insertAdjacentHTML('afterbegin', loadcertification())
    rocket.innerHTML += loadRocket()
    astronaut.innerHTML = loadAstronaut()
    sobre.insertAdjacentHTML('afterbegin', loadSobre())
}

